import React, { useState } from "react";
//import { Navbar, NavbarBrand, Nav, NavDropdown } from "react-bootstrap";
import { AppBar, Toolbar, Button, Typography, Menu, MenuItem } from "@material-ui/core";

function HeadBar() {
  const [about, setAbout] = useState(null);
  const [info, setInfo] = useState(1);
  const [resource, setResource] = useState(2);

  const aboutClick = (event) => {
    setAbout(event.currentTarget);
  };

  const infoClick = (event) => {
    setInfo(event.currentTarget);
  };

  const resourceClick = (event) => {
    setResource(event.currentTarget);
  };

  const aboutClose = () => {
    setAbout(null);
  };

  const infoClose = () => {
    setInfo(null);
  };

  const resourceClose = () => {
    setResource(null);
  };

  return (
    <AppBar position="static">

      <Typography 
        style={{fontFamily:"cursive", 
                fontSize:"40px", 
                fontStyle:"italic", 
                marginLeft:"20px", 
                marginTop:"10px"}}
      >
              Math Is Cool
      </Typography>

      <Toolbar>
        <Button color="inherit" href="/">Home</Button>
        <div>
          <Button aria-controls="fade-menu" aria-haspopup="true" color="inherit" onClick={aboutClick}>About Us</Button>
          <Menu
            id="fade-menu"
            anchorEl={about}
            keepMounted
            open={Boolean(about)}
            onClose={aboutClose}
          >
            <MenuItem href="/about/history">History</MenuItem>
            <MenuItem href="/about/contacts">Contacts</MenuItem>
            <MenuItem href="/about/locations">Locations</MenuItem>
          </Menu>
        </div>
        <Button color="inherit" href="/information/fees">Information</Button>
        <Button color="inherit" href="/resources/rules">Resources</Button>
        <Button color="inherit" href="/competitions">Competitions</Button>
        <Button color="inherit" href="/login">Login</Button>
      </Toolbar>
    </AppBar>
  );
}

export default HeadBar;
